import PropTypes from 'prop-types'

const Home = props => {
    return (
        <div>
            <h1>Home Sweet Home</h1>
            <img src={htmlLogo} alt='' /> 
          <img src={cssLogo} alt='HTML logo' />
 <img src={jsLogo} alt='HTML logo' />
        </div>
    )
}

